import React, { Component } from "react";
import ReactDOM from "react-dom";
import ReactCardCarousel from "react-card-carousel";
import { Link } from "react-router-dom";
import mainLayout from "./mainLayout.js";
import './Team.css'
import nicole from "./img/nicole.png"
import Image from 'react-bootstrap/Image'


class Team extends Component {

  render() {
    return (
      <div>
      <div className = "previewdesc">
      <h2 className = 'previewtitle' style={{ textDecoration: 'underline black' }}> behind honestly. </h2>
      </div>
      <div className = 'team'>
        <Image src={nicole} fluid className='imagecover'/>
        <Image src={nicole} fluid className='imagecover'/>
      </div>
      </div>
    );
  }
}

export default mainLayout(Team);
